import React from "react";
import { Navbar, NavItem, Icon } from "react-materialize";
import "./header.css";
const Header = props => {
    return (
        <Navbar
            style={styles.nav}
            alignLinks="right"
            brand={<a style={styles.navLogo} className="brand-logo" href="#">Name Goes Here</a>}
            menuIcons={<Icon>menu</Icon>}
            options={{
                draggable: true,
                edge: "left",
                inDuration: 250,
                onCloseEnd: null,
                onCloseStart: null,
                onOpenEnd: null,
                onOpenStart: null,
                outDuration: 200,
                preventScrolling: true
            }}
        >
            <NavItem href="#">
                Getting started
            </NavItem>
            <NavItem href="#">
                Categories
            </NavItem>
            <NavItem style={{marginRight: 10}} href="#">
                <Icon>search</Icon>
            </NavItem>
            </Navbar>
    )
};

const styles = {
    nav: {
        backgroundColor: "black"
    },
    navLogo: {
        marginLeft: '2%'
    }
}

export default Header;
